export default {
  path: '/Report',
  name: 'ReportIndex', // 这里必须与组件名一致
  meta: { title: '产品信息', requiresAuth: true },
  component: () => import('../views/report/Index.vue'),
  redirect: '/report/ReportList',
  children:[
    {
      path: 'reportList',
      name: 'reportIndex', // 这里必须与组件名一致
      meta: { title: '产品信息', requiresAuth: true },
      component: () => import('../views/report/ReportList.vue'),
    },
    {
      path: 'Detail/:id',
      name: 'ProductDetail', // 命名规则 [模块名+文件名]
      meta:{
        title: '产品详情',
        requiresAuth: true
      },
      redirect:'Detail/:id/ProductInformation',
      component: () => import('../views/product/Detail.vue'),
      children:[
        {
          path: 'productInformation',
          name: 'ProductInformation', // 命名规则 [模块名+文件名]
          meta:{
            title: '产品信息',
            requiresAuth: true
          },
          component: () => import('../views/product/ProductInformation.vue'),
        },

      ]

    }
  ]
};
